import './App.css'
import React, { Component } from 'react'
import Customer from './components/Customer'

const customers = [
  {
    name: '홍길동',
    birthday: '901111',
    gender: '남자',
    job: '대학생',
    image: 'https://placeimg.com/195/195/1',
  },
  {
    name: '홍두깨',
    birthday: '781111',
    gender: '남자',
    job: '개발자',
    image: 'https://placeimg.com/195/195/2',
  },
  {
    name: '김철수',
    birthday: '581111',
    gender: '남자',
    job: '기술자',
    image: 'https://placeimg.com/195/195/3',
  },
]

class App extends Component {
  render() {
    return (
      <div className="App">
        {customers.map((c) => {
          return (
            <Customer
              name={customers[c].name}
              birthday={customers[c].birthday}
              gender={customers[c].gender}
              job={customers[c].job}
              image={customers[c].image}
            />
          )
        })}
        <Customer
          name={customers[0].name}
          birthday={customers[0].birthday}
          gender={customers[0].gender}
          job={customers[0].job}
          image={customers[0].image}
        />
        <Customer
          name={customers[1].name}
          birthday={customers[1].birthday}
          gender={customers[1].gender}
          job={customers[1].job}
          image={customers[1].image}
        />
        <Customer
          name={customers[2].name}
          birthday={customers[2].birthday}
          gender={customers[2].gender}
          job={customers[2].job}
          image={customers[2].image}
        />
      </div>
    )
  }
}

export default App
